0420867 Раздел 1, 0420874 Раздел 4. При отражении информации по показателю: "Актив, стоимость" в разрезе ГАП "Класс активов" (по АП "Дебиторская задолженность по накопленному процентному доходу"), "Код валюты", "Идентификатор счета по депозиту", "Идентификатор кредитной организации", "Идентификатор управляющей компании", "Идентификатор договора доверительного управления", "Классификация финансового актива в соответствии с Международным стандартом финансовой отчетности (IFRS) 9" в отчете должна быть представлена информация по показателям:
для НПД по депозитным сертификатам - "Тип ценной бумаги (вид финансового инструмента)";
для НПД по депозитам - "Дата размещения депозита", "Дата возврата депозита по первоначальному договору", "Текущая процентная ставка по депозиту, процентов годовых", "Периодичность выплаты процентов", "Субординированность (для облигаций и депозитов)" в разделе 4 формы 0420874. При этом значение ГАП "Идентификатор счета по депозиту" показателя "Актив, стоимость" должно соответствовать значению ГАП "Идентификатор счета по депозиту" показателей: "Дата размещения депозита", "Дата возврата депозита по первоначальному договору", "Текущая процентная ставка по депозиту, процентов годовых", "Периодичность выплаты процентов", "Субординированность (для облигаций и депозитов)".
